import React from "react";
import Navbar from "./components/Navbar";
import MainContent from "./components/MainContent";
import Footer from "./components/Footer";
import todoList from "./todoList";

function App() {
  return (
    <div>
      <Navbar />
      <MainContent />
      <Footer />
      <todoList />
    </div>
  );
}
export default App;
